import React from "react";


const Home=()=>{
    return(<>
        <section id="header">
        <div className="container-fluid nav_bg">
        <div className="row">
        <div className="col-10 mx-auto">
        <div className="col-md-6 pt-4 pt-lg-0 order-2 order-lg-1">
        <h1>Grow your business with <strong>infoplus Technologies</strong></h1>
        <h2 className="my-3">We have talented developer making website</h2>
        <div>
            <a href="">Get Started</a>
        </div>

        </div>
        </div>
        </div>
        </div>

        </section>
    </>
    );
};

export default Home;
